      <div className={`${style["font-movie"]} ${style["container-booking"]}`}>
        <div className={`${style["container-content"]} text-white`}>
          <div className="row">
            <div className="col-7"></div>
            .col-5
          </div>
        </div>
      </div>
    );
  }
}
